import React from "react";
import "./style.css";
import map from "../../images/world_map-1.png";

function WorldMap(props) {
  console.log(map);
  return (
    <div className="mapWrapper">
      <div className="image-container">
        <img className="worldMap" src={map} alt="world map" />
        <div>
          <a onClick={handleInputClick}><span className="dot northAmerica-dot" data-search="north america"/></a>
          <span className="dot southAmerica-dot" data-search="south america"/>
          <span className="dot africa-dot" data-search="africa"/>
          <span className="dot europe-dot" data-search="europe"/>
          <span className="dot asia-dot" data-search="asia"/>
          <span className="dot australia-dot" data-search="australia"/>
        </div>
      </div>
    </div>
  );
}

export default WorldMap;
